import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row'
import Nav from 'react-bootstrap/Nav';
import Col from 'react-bootstrap/Col'
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useState } from 'react';
import $ from 'jquery';
function NavBar() {

  const [text,updateText] = useState('');


  function addHoverBrackets(event) {


    event.target.innerHTML = '['+event.target.innerHTML+']';

  }

  function removeHoverBrackets(event) {


    let text = event.target.innerHTML
    text = text.substring(1,text.length-1)
    event.target.innerHTML = text;
  }


  return (
    <Navbar expand="lg"  className = 'm-3 justify-content-around ' >


          <Navbar.Brand href="#home" style = {{fontFamily: 'Sacramento, cursive', fontSize: '3rem', marginLeft:'25px'}}>Fahad Al-Araik</Navbar.Brand>


          <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav" className="justify-content-end" style = {{marginRight:'50px'}}>

          <Nav className = 'pl-3 pr-3' style = {{fontSize:'1.5rem'}} >

            <Nav.Link href="#home" id = 'navbar-item' onMouseEnter={addHoverBrackets} onMouseLeave={removeHoverBrackets} >Home</Nav.Link>

            <Nav.Link href="#about-me" id = 'navbar-item' >About Me</Nav.Link>

            <Nav.Link href="#skills" id = 'navbar-item' >Skills</Nav.Link>

            <Nav.Link href="#certificates" id = 'navbar-item' >Certificates</Nav.Link>

            <Nav.Link href="#projects" id='navbar-item'>Projects</Nav.Link>
          </Nav>

            </Navbar.Collapse>


    </Navbar>
  );
}

export default NavBar;
